const StoreList = (): JSX.Element => {


  const { getProducts } = useActions()

  useEffect(() => {
    getProducts()
  }, [])


  if (loading) {
    return <Spinner />
  }
  if (error) {
    return <h1>Error</h1>
  }
  return (
    <div className="site-card-wrapper">
      <Row gutter={[26, 26]}>
        {
          products.map(product => {

            return (
              <StoreListItem key={product.id} product={product}/>
            )
          })
        }
      </Row>
    </div>
  )
}



